import React from "react";
import './Circle.css';

function Circle(props){
    return (
        <>
        {props.rate}

        <div className="yellowCircle"  style={{
            width: "30px",
            height: "30px",
            borderRadius: "30px",
            margin: "5px",
            backgroundColor:
            "rgb(255, 235, 59)"
          }}>
          </div>
          <div className="greyCircle" style={{
            width: "30px",
            height: "30px",
            borderRadius: "30px",
            margin: "5px",
            backgroundColor: "rgb(221, 221, 221)"
          }}>
          </div>
          <div className="greyCircle" style={{
            width: "30px",
            height: "30px",
            borderRadius: "30px",
            margin: "5px",
            backgroundColor: "rgb(221, 221, 221)"
          }}>
          </div>
          <div className="greyCircle" style={{
            width: "30px",
            height: "30px",
            borderRadius: "30px",
            margin: "5px",
            backgroundColor: "rgb(221, 221, 221)"
          }}>
          </div>
          <div className="greyCircle" style={{
            width: "30px",
            height: "30px",
            borderRadius: "30px",
            margin: "5px",
            backgroundColor: "rgb(221, 221, 221)"
          }}>
          </div>
          </>
    )
}

export default Circle;
